import React from "react";

const Sidebar = () => {
  return (
    <div class="navbar">
      <button>Item1</button>
      <button>Item2</button>
      <button>Item3</button>
      <button>Item4</button>
      <button>Item5</button>
    </div>
  );
};

export default Sidebar;
